        <script>
            function showTooltip(evt, text) {
                let tooltip = document.querySelector(".tooltip-container");
                tooltip.innerHTML = text;
                tooltip.style.display = "block";
                tooltip.style.position = "absolute";
                tooltip.style.left = evt.pageX + 10 + 'px';
                tooltip.style.top = evt.pageY + 10 + 'px';
            }

            function hideTooltip() {
                var tooltip = document.querySelector(".tooltip-container");
                tooltip.style.display = "none";
            }

            var tooltips = document.querySelectorAll('a[class*="link-state--"]');

            tooltips.forEach(element => {
                element.addEventListener('mousemove', function(evt) {
                    showTooltip(evt, element.getAttribute('data-tooltip'));
                });
                element.addEventListener('mouseout', function() {
                    hideTooltip();
                });

                element.addEventListener('focus', function(evt) {
                    let tooltip = document.querySelector(".tooltip-container");
                    let elementFocus = element.getBoundingClientRect();
                    tooltip.innerHTML = element.getAttribute('data-tooltip');
                    tooltip.style.display = "block";
                    tooltip.style.position = "fixed";


                    tooltip.style.left = elementFocus.left + 50 + 'px';
                    tooltip.style.top = elementFocus.top + 50 + 'px';
                });

                element.addEventListener('blur', function(evt) {
                    let tooltip = document.querySelector(".tooltip-container");
                    tooltip.style.display = "none";
                });
            });
        </script>
